impl Solution {
    pub fn number_of_beautiful_integers(low: i32, high: i32, k: i32) -> i32 {
        let mut count = 0;
        for num in low..=high {
            if num % k == 0 && Self::is_beautiful(num) {
                count += 1;
            }
        }
        count
    }

    fn is_beautiful(num: i32) -> bool {
        let mut num = num;
        let mut even_count = 0;
        let mut odd_count = 0;
        while num > 0 {
            let digit = num % 10;
            if digit % 2 == 0 {
                even_count += 1;
            } else {
                odd_count += 1;
            }
            num /= 10;
        }
        even_count == odd_count
    }
}
